import "./Home.css";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="home">
      {/* HERO SECTION */}
      <div className="hero">
        <div className="hero-content">
          <h1>Luxury Salon Experience</h1>
          <p>
            Premium hair, beauty & spa services crafted for your style and comfort.
          </p>

          <Link to="/services" className="hero-btn">
            Book Your Service
          </Link>
        </div>
      </div>

      {/* SERVICES PREVIEW */}
      <div className="preview">
        <h2>Our Premium Services</h2>

        <div className="preview-grid">
          <div className="preview-card">Hair Cut</div>
          <div className="preview-card">Facial</div>
          <div className="preview-card">Pedicure</div>
          <div className="preview-card">Spa</div>
        </div>
      </div>
    </div>
  );
}
